import Header from '.compone/Alljs/Header';
import Subheader from './Alljs/Subheader';
import FeatureSection from './Alljs/FeatureSection';
import FeatureProduct from './Alljs/FeatureProduct';
import BannerBox from './Alljs/BannerBox';
import NewsLetter from './Alljs/NewsLetter';
import Footer from './Alljs/Footer';
import "./Allcss/Footer.css";
import "./Allcss/NewsLetter.css";
import "./Allcss/BannerBox.css";
import "./Allcss/FeatureProduct.css";
import "./Allcss/FeatureSection.css";
import "./Allcss/Subheader.css";
function Home(){
    return (
        <>
        <Header/>
        <Subheader/>
        <FeatureSection/>
        <FeatureProduct/>
        <BannerBox/>
        <NewsLetter/>
        <Footer/>
        </>
    )
}
export default Home;
